import React from 'react';

const Project = (props) => {
    return(
         <div className='bg-navy ba bw1 b--dark-blue fl w-100 w-third-ns pa3' > 
            <img className='b' alt='Photo' src='' />
            <div>
                <h2 className='light-blue '>{props.title}</h2>
                <p className='washed-blue measure'>{props.summary}</p>
                <a href={props.github} >GitHub</a>
            </div>
        </div>
    );
}

export default Project;
